import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import MainContent from './components/MainContent';
import Interface1 from './components/Interface1';
import Interface2 from './components/Interface2';
import Interface3 from './components/Interface3';
import Interface4 from './components/Interface4';

function App() {
  const navigate = useNavigate();

  return (
    <div>
      <Routes>
        <Route path="/" element={<MainContent onNavigate={navigate} />} />
        <Route path="/Interface1" element={<Interface1 onNavigate={navigate} />} />
        <Route path="/Interface2" element={<Interface2 onNavigate={navigate} />} />
        <Route path="/Interface3" element={<Interface3 onNavigate={navigate} />} />
        <Route path="/interface4" element={<Interface4 onNavigate={navigate} />} />
      </Routes>
    </div>
  );
}

export default App;
